      <h1 className="text-white text-4xl ms-28">DO YOUR BOOKINGS HERE!</h1>
      <div className="w-6/12 rotate-270">
        <img src={Map} alt="mapa" />
      </div>
      <div className="grid grid-cols-1">
        <h3 className="absolute grid ms-96 text-2xl text-black">
          LISTA DE MESAS DISPONIBLES
        </h3>
      </div>
    </div>
  );
};

export default Bookings;
